import React, { Component } from 'react';
import {
    BrowserRouter as Router,
    Route,
    Link,
} from "react-router-dom";
import Home from '../Components/Home';
import Setting from '../Components/Setting';
import Setting1 from '../Components/Setting1';


class DashboardURL extends Component {
    render() {
        return (
            <div>
                <Router>
                    <Route path="/body/" component={Home}></Route>
                    <Route path="/body/test1" component={Setting}></Route>
                    <Route path="/body/test2" component={Setting1}></Route>
                </Router>
            </div>
        );
    }
}


export default DashboardURL;
